import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () =>{
    return (
        <>
        <NavLink exact activeClassName='active_lass' to="/">About us</NavLink>
        <NavLink exact activeClassName='active_class' to="/contact">Contact us</NavLink> <br />
        <a href='/'>About</a>
        <a href='/contact'>Contact</a>
        <NavLink exact activeClassName='active_class' to="/user">User</NavLink> <br />
        </>
    )
}
export default Menu;
